    "d8a6202b-c0c3-463d-88a0-3bc021a178ed",ntt"name": "nasa-gov"nt},nt"relationships_as_subject":
    [],nt"num_tags": 3,nt"name": "lithium-battery-electrolytes-for-long-cycle-life-and-wide-operating-temperature-range-proj",nt"isopen":
    true,nt"url": null,nt"notes": "New lithium battery electrolytes must be
    developed if these they are to be successfully deployed on NASA Platforms operating
    at -100oC to +100oC.  Giner, Inc. has proposed an approach to preparing lithium
    ion conducting electrolytes which will provide cell current densities sufficient
    to carry the microwatt to milliwatt levels required for Low Earth Orbital Applications.
     Phase I will examine the low temperature phase behavior of the new electrolytes,
    ionic conductivity and chemical electrochemical stability in primary and secondary
    lithium cell environments, with exposures of up to +100oC in order to assess the
    likelihood of long cycle-life performance.rnrn",nt"owner_org": "d8a6202b-c0c3-463d-88a0-3bc021a178ed",nt"extras":
